// import logo from './logo.svg';
import './App.css';
import logo from './assets/CLC_logo1.png'
import menu from './assets/Menu.png'
import background from './assets/background.png'
import './css/app.css'

function App() {
  return (
    <div className="App">
      <div id='header' style={{backgroundColor: 'black'}}> <img className='logo' src={logo}/> <img className='menu' src={menu}/> </div>
      <div className='above-fold' style={{background: background}}>
        <p className='headline'>Real Estate Investments</p>
        <p className='headline'>& Capital Markets</p>
        <p className='sub-headline'>We create capital solutions across real estate.</p>
      </div>
    </div>
  );
}

export default App;
